import "./App.css";

function App() {
  return (
    <div>
      <NavigationBar></NavigationBar>
      <SwitchBar></SwitchBar>
      <FooterBar></FooterBar>
    </div>
  );
}

function NavigationBar() {
  return <h1>This is a NavigationBar</h1>;
}

function SwitchBar() {
  return <h1>This is a SwitchBar</h1>;
}

function FooterBar() {
  return <h1>This is a FooterBar</h1>;
}

export default App;
